score_df[columns_to_round] = score_df[columns_to_round].round(2) #2 sig fig is ok i guess

score_df.head(10)

# we add that score to our df_true for finalizing
df_true = df_true.merge(score_df, on='pl_name', how='left')

df_true.head()

correlation, p_value = stats.pearsonr(df_true['st_teff_sa'], df_true['hab_score_a'])

print(f"Correlation coefficient: {correlation}")
print(f"P-value: {p_value}")

alpha = 0.05  # Significance level

if p_value > alpha:
    print("The null hypothesis cannot be rejected.")
    print("There is no statistically significant correlation between st_teff_sa and hab_score_a.")
else:
    print("The null hypothesis is rejected.")
    print("There is a statistically significant correlation between st_teff_sa and hab_score_a.")

plt.figure(figsize=(8, 6))
sns.regplot(x='st_teff_sa', y='hab_score_a', data=df_true)
plt.xlabel('st_teff_sa')
