plt.grid(True)

X = df_true['st_teff_sa']
y = df_true['hab_score_a']
X = sm.add_constant(X)  # Conradium
model = sm.OLS(y, X).fit()
y_pred = model.predict(X)
plt.plot(df_true['st_teff_sa'], y_pred, color='red', label='Regression Line')
plt.legend()
